import { useState, useEffect } from 'react'
import { Card } from 'antd'
import './CarsCard.css'

const apiUrl = 'http://localhost:8000/api/cars'

function CardList() {
    const [cars, setCars] = useState([])

    const getAllCars = async () => {
        try {
            const response = await fetch(apiUrl)
            const data = await response.json()
            setCars(data)

        } catch (error) {
            console.log(error);
        }
    }

    useEffect(() => {
        getAllCars()
    }, [])

    return (
        <div className='cardGeral'>
            {
                cars.map((oneCar) => {
                    return (
                        <Card>
                            <p>{oneCar.BRAND}</p>
                            <p>{oneCar.MODEL}</p>
                            <p >{oneCar.DEALER}</p>
                            <p>{oneCar.MIN_MILEAGE}</p>
                            <p>{oneCar.MAX_MILEAGE}</p>
                        </Card>
                    )
                })
            }
        </div>
    );
}

export default CardList;
